/// Look up theme colors by name
pub fn get(name: []const u8) ?ThemeColors {
    return themes.get(name);
}

test "theme lookup" {
    // Test a known theme
    const dracula = get("dracula");
    try std.testing.expect(dracula != null);
    try std.testing.expectEqual(@as(u8, 0xf8), dracula.?.fg[0]);

    // Test unknown theme
    const unknown = get("not-a-real-theme");
    try std.testing.expect(unknown == null);
}
